import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import CardList from "./components/CardList";
import Gambar from "./assets/images/batik.png";
import Quotes from "./components/Quotes";
const quotes="Assalamualaikum";
const students = [
  {nama :'Dzakwan',nim:'123',kelompok:'1',},
  {nama :'abel',nim:'234',kelompok:'3',},
  ]

  {students.map((item,index)=>(
  <CardList id={index} name={item.nama} nim={item.nim} kelompok={item.kelompok} />
  ))
  }

ReactDOM.render(
  <React.StrictMode>
    <App />
    <CardList name="dzakwan" nim="211201181..." kelompok="35" isNameBold image={Gambar} />
    <Quotes author="Orang" quotes={quotes} />
  </React.StrictMode>,
  document.getElementById("root")
);
